import React from 'react';
import { useNavigate } from 'react-router-dom';
import HomeImage from './image/logo/admin_home.png';
import './css/App.css';

function Home() {
  const navigate = useNavigate();

  const handleButtonClick = () => {
    // Handle button click logic here
    // For now, let's navigate to a specific route
    navigate('/Admin_Options');
  };

  return (
    <div className="admin-home-container">
      <img src={HomeImage} alt="UGBN" className="admin-home-background-image" />

      <button className="admin-options-button" onClick={handleButtonClick} style={{ fontSize: '20px' }}>
        Your Button Text
      </button>
    </div>
  );
}

export default Home;
